import React, { useState } from "react";
import data from "./data";
import SingleQuestion from "./Question";
function App() {
	const [index, setIndex] = useState(0);
	const { id, title, info } = data[index];
	return (
		<div key={id} className="container">
			<div>{title}</div>
			<div>{info}</div>
		</div>
	);
}

export default App;
